import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
function App() {
  return (
    <div className="App">
      <Header/>
      <div style={{display : "flux", "flux-direction":"row"}}>
        <Sidebar/>
        <Sidebar/>
        <Sidebar/>
        <Sidebar/>
      </div>
    </div>
  );
}

export default App;
